// {"QAAMZ_1":0,"QAAMZ_2":1,"QAAMZ_3":0,"QAAMZ_4":0}
var payloadObj = msg.payload;
var activeKey = null;

// Find the first key with value 1
for (var key in payloadObj) {
    if (payloadObj[key] === 1) {
        activeKey = key;
        break;
    }
}

var newValue = 0;
if (activeKey) {
    // Map the active key to a random value based on specified ranges
    if (activeKey === "QAAMZ_2") {
        // Random value between 14.2 and 14.7
        newValue = Math.random() * (14.7 - 14.2) + 14.2;
    } else if (activeKey === "QAAMZ_3") {
        // Random value between 2.9 and 3.5
        newValue = Math.random() * (3.5 - 2.9) + 2.9;
    } else if (activeKey === "QAAMZ_1") {
        // Random value between 4.5 and 5.2
        newValue = Math.random() * (5.2 - 4.5) + 4.5;
    }
    // Round the new value to 2 decimal places
    newValue = Number(newValue.toFixed(2));
}

// If no active key, newValue remains 0
msg.payload = { instantaneous_flow: newValue };
msg.topic = "air/flow"
return msg;

// Define the MQTT topics and their timing sequences
var sequence = [
    { topic: "usbrelay/control/QAAMZ_2", delay: 6000 }, // 6 sec
    { topic: "usbrelay/control/QAAMZ_2", delay: 1000 }, // 1 sec
    { topic: "usbrelay/control/QAAMZ_3", delay: 6000 }, // 6 sec
    { topic: "usbrelay/control/QAAMZ_3", delay: 1000 }, // 1 sec
    { topic: "usbrelay/control/QAAMZ_1", delay: 6000 }, // 6 sec
    { topic: "usbrelay/control/QAAMZ_1", delay: 1000 }  // 1 sec
];

// Array to store all messages to be sent
var messages = [];

// Function to publish messages with delay
function publishMessages(index) {
    if (index >= sequence.length) {
        // When sequence is complete, send the ending message
        node.send({ topic: "autotest/flow1/stage", payload: ": " });
        return;
    }

    // Create and send the next MQTT message
    var msg = {
        topic: sequence[index].topic,
        payload: "toggle"
    };
    node.send(msg);

    // Schedule the next message with the defined delay
    setTimeout(() => publishMessages(index + 1), sequence[index].delay);
}

// Send the start message
node.send({ topic: "autotest/flow1/stage", payload: ": " });

// Start the sequence after the start message is sent
setTimeout(() => publishMessages(0), 1000); // Small delay before starting the sequence

